import React from 'react';
import logo from './42_Logo.svg.png';
import './App.css';
import { Avatar, Box, Button, Container } from '@mui/material';
import { Helmet } from 'react-helmet';
import Dashboard from './components/Dashboard/Dashboard';
import Preferences from './components/Preferences/Preferences';
import { BrowserRouter, Route, Routes } from 'react-router-dom';


function App() {
  return (
    <div className="App" style={{}}>
      <Helmet>
        <style>{'body { background-color: black; }'}</style>
      </Helmet>
      <Box mt={42}>
        <Button variant="contained" sx={{ fontWeight: 'bold',fontSize: 'h8.fontSize' }} style={{backgroundColor:'#424242'}} startIcon={<Avatar variant="square" src={logo}/>}
           target="_blank"
           component="a"
          //  href="http://ssh.billyboy.fr:3000/api/auth/login">
           href="https://google.com">
          Connect
        </Button>

      </Box>
        <BrowserRouter>
        <Routes>
          <Route path="/dashboard">
            <Dashboard />
          </Route>
          <Route path="/preferences">
            <Preferences />
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
